import React from "react";
import moment from "moment";
import AccordionUpArrow from "./AccordionUpArrow";

function WeatherDetailsHeader({
  activeState,
  activeDate,
  toggleAccordion,
  detailsHandler,
  setRotate,
}) {
  return (
    <div>
      <div className={`accordion ${activeState}`}>
        <ul className="days_inner_list">
          {weeklyWeather
            ? pr.weeklyWeather.map((value, i) => {
                const day = moment.unix(value.dt).utc();
                if (i <= 8) {
                  console.log("value.dt=====", day);
                  return (
                    <>
                      <li
                        className={`day_content ${
                          value.dt === activeDate ? "active" : ""
                        }`}
                        onClick={() =>
                          value.dt === activeDate
                            ? toggleAccordion()
                            : detailsHandler(value)
                        }
                      >
                        <span className="gutter__right">
                          {moment(day).format("ddd")},
                        </span>
                        <span>{moment(day).format("MMMM Do")}</span>
                      </li>
                    </>
                  );
                }
              })
            : null}
        </ul>
        <AccordionUpArrow
          toggleAccordion={toggleAccordion}
          setRotate={setRotate}
        />
      </div>
    </div>
  );
}

export default WeatherDetailsHeader;
